import { StyleSheet, Text, TouchableOpacity, View } from "react-native";
import React, { useEffect, useState } from "react";
import { SafeAreaView } from "react-native-safe-area-context";
import { useDispatch, useSelector } from "react-redux";
import {
  MaterialCommunityIcons,
  MaterialIcons,
  SimpleLineIcons,
} from "@expo/vector-icons";
import CustomPicker from "../components/CustomPicker";
import OrderPicker from "../components/OrderPicker";
import ProgressBar from "../components/ProgressBar";

const Spot = ({ route, getCoinMarket, coins }) => {
  const [currentPrice, setCurrentPrice] = useState(null);
  const [selectedCoin, setSelectedCoin] = useState({});
  const [coin, setCoin] = useState("bitcoin");
  const [isLoading, setIsLoading] = useState(true);
  const userId = useSelector((state) => state?.userReducer?.currentUser?._id);

  const dispatch = useDispatch();
  const { coinId, itemSymbol } = route.params || {
    coinId: "bitcoin",
    itemSymbol: "BTC",
  };
  console.log("id", coinId);
  useEffect(() => {
    // Filter the coins array to get the selected coin's data
    const selectedCoinData = coins?.find((coin) => coin.id === coinId);
    // console.log("selectedCoinData,selectedCoinData",selectedCoinData);
    if (selectedCoinData) {
      // Update the state with the selected coin's data
      setCurrentPrice(selectedCoinData.current_price);
      setSelectedCoin(selectedCoinData);
      setIsLoading(false);
    }
  }, [coins]);
  return (
    <SafeAreaView>
      <View
        style={{ backgroundColor: "#212121", height: "100%", width: "100%" }}
      >
        <View
          style={{
            flexDirection: "row",
            justifyContent: "space-between",
            padding: "5%",
          }}
        >
          <View
            style={{
              flexDirection: "row",
              alignItems: "center",
            }}
          >
            <SimpleLineIcons name="menu" size={20} color="white" />
            <Text
              style={{
                marginLeft: 5,
                color: "white",
                fontWeight: "bold",
                fontSize: 17,
              }}
            >
              {itemSymbol.toUpperCase()}/USDT
            </Text>
          </View>

          <View style={{ flexDirection: "row" }}>
            <MaterialCommunityIcons
              name="information-outline"
              size={24}
              color="white"
              style={{ marginRight: 6 }}
            />
            <MaterialIcons name="stars" size={24} color="white" />
          </View>
        </View>
        <View
          style={{
            flexDirection: "row",
            width: "100%",
            paddingHorizontal: "3%",
          }}
        >
          <View
            style={{
              flexDirection: "row",
              justifyContent: "space-between",
              width: "45%",
              paddingHorizontal: "2%",
            }}
          >
            <View>
              <Text style={{ color: "white" }}>Price</Text>
              <Text style={{ color: "white" }}>(USDT)</Text>
            </View>
            <View>
              <Text style={{ color: "white" }}>Volume</Text>
              <Text style={{ color: "white" }}>(BTC)</Text>
            </View>
          </View>
          <View style={{ flexDirection: "column", width: "55%" }}>
            <View style={{ flexDirection: "row" }}>
              <TouchableOpacity style={[styles.button, styles.buyUpButton]}>
                <Text style={{ color: "white" }}>Buy</Text>
              </TouchableOpacity>
              <TouchableOpacity style={[styles.button, styles.buyDownButton]}>
                <Text style={{ color: "white" }}>Sell</Text>
              </TouchableOpacity>
            </View>
            <OrderPicker />

            <View
              style={{
                width: "100%",
                paddingVertical: 12,
                paddingHorizontal: 4,
                backgroundColor: "gray",
                marginTop: 15,
              }}
            >
              <Text style={{ color: "white", fontSize: 12 }}>
                Trade at the current best price
              </Text>
            </View>
            <View style={{}}>
              <ProgressBar />
            </View>
          </View>
        </View>
      </View>
    </SafeAreaView>
  );
};

export default Spot;

const styles = StyleSheet.create({
  button: {
    width: "50%",
    height: 50,
    // borderRadius: 10,
    // paddingHorizontal: 30,
    // paddingVertical: 12,
    justifyContent: "center",
    alignItems: "center",
    // marginVertical: 10,
  },
  buyUpButton: {
    backgroundColor: "green",
  },
  buyDownButton: {
    backgroundColor: "red",
  },
  buttonText: {
    color: "white",
    fontSize: 16,
    fontWeight: "bold",
  },
});
